import React from "react";

function ContentList(props) {
  return (
    <div>
      <h5>{props.heading}</h5>
      <ul>
        {props.content.map((text, index) => {
          return <li key={index}>{text}</li>;
        })}
      </ul>
    </div>
  );
}

export default ContentList;
